function Registration() {
    return (
<div id="modal2" className="modal">
    <div className="modal-content">
            <div className="row">
             <form className="col s12">

                                        <div className="input-field col s12">
                                          <input id="emaillogin" type="text" className="validate" data-length="15" maxlength="15"></input>
                                          <label for="emaillogin">Email</label>
                                        </div>
                                        <div class="input-field col s12">
                                          <input id="contraseñalogin" type="tel" className="validate" data-length="10" maxlength="10"></input>
                                          <label for="contraseñalogin">Contraseña</label>
                                        </div>
            </form>
            </div>
            </div>
            </div>

    );
} 

export default Registration;
